export class JobExecution {
  constructor(
    public id?: number,
    public jobInstanceId?: number,
    public status?: string,
    public startTime?: any,
    public endTime?: any,
    public jobName?: string,
    public jobScheduleId?: string,
    public duration?: string
  ) {}
}

export class SearchParamModel {
  constructor(public jobName?: any, public jobStartDateAsStr?: any, public jobEndDateAsStr?: any, public jobStatus?: any) {}
}

export class JobExecutionStep {
  constructor(
    public id?: number,
    public stepName?: any,
    public jobExecutionId?: any,
    public startTime?: any,
    public endTime?: any,
    public status?: any,
    public commitCount?: any,
    public readCount?: any,
    public filterCount?: any,
    public writeCount?: any,
    public readSkipCount?: any,
    public writeSkipCount?: any,
    public processSkipCount?: any,
    public rollbackCount?: any,
    public exitCode?: any,
    public exitMessage?: any
  ) {}
}

export class JobExecutionParameter {
  constructor(
    public id?: number,
    public typeCD?: any,
    public keyName?: any,
    public stringValue?: any,
    public dateValue?: any,
    public longValue?: any,
    public doubleValue?: any,
    public identifying?: any
  ) {}
}

export const JobExecutionStatus = [
  { label: 'STARTED', value: 'STARTED' },
  { label: 'COMPLETED', value: 'COMPLETED' },
  { label: 'FAILED', value: 'FAILED' }
];
